import React from 'react';
import "./App.css";
import 'bootstrap/dist/css/bootstrap.min.css';

function App()
{
	return(
	<div class="container">	
		<div class="inline">
			<a id="title" id="title" href="home.html">
				<h4>&emsp;&emsp;Home</h4>
			</a>
		</div>

		<nav class="inline">
			<ul>
				<li><a href="dnc.html" class="button">Divide And Conquer</a></li>
				<li><a href="greed.html">Greedy strategy</a></li>
				<li><a href="dp.html">Dynamic Programming</a></li>
				<li><a href="contact.html">Contact</a></li>
			</ul>
		</nav>
	</div>
	);
}

export default App;
